response.about:
Меня зовут Диана, я мама ребенка с пороком сердца и психолог, и моя работа заключается в помощи людям, которые оказались в трудных жизненных ситуациях и, в частности, в связи с диагнозом ВПС у ребёнка.

Ко мне можно обратиться за консультацией как к психологу и кардиомаме, которая понимает, как бывает сложно:
— когда родитель лежит с ребёнком в больнице, и он находится в операционной или в реанимации;
— когда высокое напряжение может спровоцировать проблемы между мужем и женой или другими родственниками, вплоть до полного распада семьи;
— когда после операции у ребёнка явный регресс или отставание в развитии;
— когда возникают сложности с адаптацией ребёнка в детском саду, в школе или, когда становится понятно, что он вообще никогда туда не пойдет из-за ОВЗ или инвалидности;
...и во многих других, невероятно сложных ситуациях, в которых могут оказаться близкие больных детей.

Я оказываю бесплатную психологическую помощь, и вы можете обратиться ко мне за консультацией, когда бывает сложно справляться с переживаниями, вызванными болезнью ребёнка или, когда просто хочется поговорить и найти понимание.

Буду рада оказать вам поддержку.
